INSERT INTO `t_list` (`file_id`, `src_video`, `video_size`, `title`, `serifu`, `koner`, `roma`, `src_image`, `status`, `level`, `clicks`, `stars`, `cate`, `c_date`) VALUES
('m_kgr_0_0', 'https://video-1256378396.cos.ap-guangzhou.myqcloud.com/m_kgr_0_0.mp4', 763414, '神乐_触碰', 'あ、小白(こはく)の毛繕(けずくろ)いしてあげなきゃ', '啊，该给小白修修毛了', 'a, kohaku no kezukuroi shite agenakya', 'https://image-1256378396.cos.ap-guangzhou.myqcloud.com/m_kgr_0.png', 1, 'm', 0, 190, 'y', '2019-03-31 13:37:32'),
('m_kgr_0_1', 'https://video-1256378396.cos.ap-guangzhou.myqcloud.com/m_kgr_0_1.mp4', 826017, '神乐_触碰', 'どうかしたの？なんでもない？うん…', '有什么事吗？没有？唔…', 'doukashita no, nan demo nai, un', 'https://image-1256378396.cos.ap-guangzhou.myqcloud.com/m_kgr_0.png', 1, 'm', 0, 200, 'y', '2019-03-31 13:38:26'),
('m_kgr_0_2', 'https://video-1256378396.cos.ap-guangzhou.myqcloud.com/m_kgr_0_2.mp4', 763074, '神乐_触碰', '私(わたし)は晴明(せいめい)を助(たす)ける、そう決(き)めたから', '我要帮助晴明，这件事是早就决定好了的', 'watashi wa seimei wo tasukeru, sou kimeta kara', 'https://image-1256378396.cos.ap-guangzhou.myqcloud.com/m_kgr_0.png', 1, 'm', 0, 190, 'y', '2019-03-31 13:38:52'),
('m_sm_0_0', 'https://video-1256378396.cos.ap-guangzhou.myqcloud.com/m_sm_0_0.mp4', 1099476, '晴明_触碰', '人間(にんげん)とあやかし、どちらにも心(こころ)はある', '人类与妖怪都是有心灵的', 'ningen to ayakashi, dochira nimo kokoro wa aru', 'https://image-1256378396.cos.ap-guangzhou.myqcloud.com/m_sm_0.png', 1, 'm', 0, 180, 'y', '2019-01-23 11:33:37'),
('m_sm_0_1', 'https://video-1256378396.cos.ap-guangzhou.myqcloud.com/m_sm_0_1.mp4', 821006, '晴明_触碰', '安(あ)倍(べ)晴明(せいめい)の名(な)で、招来(しょうらい)', '以安倍晴明之名，招来', 'abe-no-seimei no na de, shourai', 'https://image-1256378396.cos.ap-guangzhou.myqcloud.com/m_sm_0.png', 1, 'm', 0, 180, 'y', '2019-01-23 11:34:17'),
('m_sm_0_3', 'https://video-1256378396.cos.ap-guangzhou.myqcloud.com/m_sm_0_3.mp4', 818631, '晴明_触碰', '母上(ははうえ)、どこにいらっしゃるのですか', '母亲大人，您究竟在哪里', 'hahaue, doko ni irassharu no desu ka', 'https://image-1256378396.cos.ap-guangzhou.myqcloud.com/m_sm_0.png', 1, 'm', 0, 180, 'y', '2019-01-23 11:34:54'),
('m_sm_0_4', 'https://video-1256378396.cos.ap-guangzhou.myqcloud.com/m_sm_0_4.mp4', 832882, '晴明_触碰', '己(おのれ)の欲(よく)のために陰(おん)　陽(みょう)　術(じゅつ)を使(つか)ってはならぬ', '不能因为一己私欲而行使阴阳术', 'onore no yoku no tame ni onmyoujutsu wo tsukatte wa naranu', 'https://image-1256378396.cos.ap-guangzhou.myqcloud.com/m_sm_0.png', 1, 'm', 0, 180, 'y', '2019-01-23 11:35:51'),
('n_bah_0_0', 'https://video-1256378396.cos.ap-guangzhou.myqcloud.com/n_bah_0_0.mp4', 929593, '彼岸花呱_触碰', 'あら、また一人(ほとり)わたしの花(はな)泥(どろ)になるおつもりね？', '哎呀，又有一个人想成为我的花泥了吗？', 'ara, mata hitori watashi no hanadoro ni naru otsumori ne', 'https://image-1256378396.cos.ap-guangzhou.myqcloud.com/n_bah_0.png', 1, 'n', 0, 92, 'y', '2019-01-23 16:41:28'),
('n_bah_1_0', 'https://video-1256378396.cos.ap-guangzhou.myqcloud.com/n_bah_1_0.mp4', 850832, '彼岸花呱_登场', '私(わたし)の花(はな)泥(どろ)…あ！顔(かお)が痛(いた)いよ…', '成为我的花泥…(脸着地)啊！脸好痛…', 'watashi no hanadoro, kao ga itai yo', 'https://image-1256378396.cos.ap-guangzhou.myqcloud.com/n_bah_0.png', 1, 'n', 0, 92, 'y', '2019-03-18 10:46:06'),
('n_bah_3_0', 'https://video-1256378396.cos.ap-guangzhou.myqcloud.com/n_bah_3_0.mp4', 777443, '彼岸花呱_技能叁', 'あなたが見(み)る世(せ)界(かい)は現(げん)実(じつ)かしら？', '你所看到的世界是否是现实？', 'anata ga miru sekai wa genjitsu kashira', 'https://image-1256378396.cos.ap-guangzhou.myqcloud.com/n_bah_0.png', 1, 'n', 0, 92, 'y', '2019-03-26 09:50:39'),
('n_bah_3_1', 'https://video-1256378396.cos.ap-guangzhou.myqcloud.com/n_bah_3_1.mp4', 687467, '彼岸花呱_技能叁', '彼(ひ)岸(がん)花(ばな)の幻(げん)影(えい)に耽(ふけ)るがいい！', '沉湎在彼岸花的幻影中吧！', 'higanbana no gen\'ei ni fukeru ga ii', 'https://image-1256378396.cos.ap-guangzhou.myqcloud.com/n_bah_0.png', 1, 'n', 0, 92, 'y', '2019-04-01 23:46:23'),
('n_bah_4_0', 'https://video-1256378396.cos.ap-guangzhou.myqcloud.com/n_bah_4_0.mp4', 714999, '彼岸花呱_受击', 'いい度(ど)胸(きょう)ね', '胆子不小呢', 'ii dokyou ne', 'https://image-1256378396.cos.ap-guangzhou.myqcloud.com/n_bah_0.png', 1, 'n', 0, 92, 'y', '2019-03-26 09:49:19'),
('n_cm_0_0', 'https://video-1256378396.cos.ap-guangzhou.myqcloud.com/n_cm_0_0.mp4', 2141732, '茨木呱_触碰', '私(わたし)の風(ふう)船(せん)…え、じゃなかった、私(わたし)の気(き)を感(かん)じよう', '见识下我的气球…呃，不对，见识下我的气势吧！', 'watashi no fuusen, ja nakatta, watashi no ki wo kanjiyou', 'https://image-1256378396.cos.ap-guangzhou.myqcloud.com/n_cm_0.png', 1, 'n', 0, 98, 'y', '2019-03-26 10:09:37'),
('n_cm_1_0', 'https://video-1256378396.cos.ap-guangzhou.myqcloud.com/n_cm_1_0.mp4', 751210, '茨木呱_登场', 'おおっと、着(ちゃく)地(ち)成(せい)功(こう)！', '哎哟…着陆成功！', 'ootto, chakuti seikou', 'https://image-1256378396.cos.ap-guangzhou.myqcloud.com/n_cm_0.png', 1, 'n', 0, 98, 'y', '2019-03-19 12:07:02'),
('n_cm_3_0', 'https://video-1256378396.cos.ap-guangzhou.myqcloud.com/n_cm_3_0.mp4', 665664, '茨木呱_技能叁', '驚(きょう)嘆(たん)せよ、私(わたし)の強(つよ)さに', '为我的强大惊叹吧', 'kyoutan seyo, watashi no tsuyosa ni', 'https://image-1256378396.cos.ap-guangzhou.myqcloud.com/n_cm_0.png', 1, 'n', 0, 98, 'y', '2019-03-26 11:52:50'),
('n_cm_3_1', 'https://video-1256378396.cos.ap-guangzhou.myqcloud.com/n_cm_3_1.mp4', 627008, '茨木呱_技能叁', '我(わ)が豪(ごう)拳(けん)、味(あじ)わうがいい！', '好好体会，吾之豪拳！', 'waga gouken, ajiwau ga ii', 'https://image-1256378396.cos.ap-guangzhou.myqcloud.com/n_cm_0.png', 1, 'n', 0, 98, 'y', '2019-03-26 11:54:34'),
