('1531904738253_1_7', '1531904738253', 7, 'ドアの　みぎに　(でんき)に　すいっちが　あります', '', '電気', '天気', '電器', '電機', 'A', '', 0, 1, '', '', '', 'someone', '2018-09-20 09:58:16'),
('1531904738253_1_8', '1531904738253', 8, 'いつも　ここで　(しんぶん)を　かいます', '', '新文', '新分', '新聞', '新本', 'C', '', 0, 1, '', '', '', 'someone', '2018-09-20 09:59:27'),
('1531904738253_1_9', '1531904738253', 9, 'らいげつの　(むいか)に　ともだちが　きます', '', '八日', '九日', '三日', '六日', 'D', '', 0, 1, '', '', '', 'someone', '2018-09-20 10:01:35'),
('1531904738253_12_1', '1531904738253', 1, '文章の(A)に入るものを、次から選びなさい', '', '幼児にあいさつ言葉をできるだけ早く覚えさせること', '騒音を出さないように気をつけること', '騒音を出している人の顔を確認すること', '近隣の人とあいさつをすること、できたら話をすること', 'D', '', 0, 12, '', '', 'あいさつの意味\r\n    「おはようございます」「こんにちは」「こんばんは」「おやすみなさい」などは、ごく一般的なあいさつの言葉です。外国旅行をするとき最初に習うのが外国語のあいさつ言葉ですし、親たちは幼児に早くからあいさつの言葉を覚えさせようと苦心します。これは、多くの人があいさつは大切なことだと思っている証拠だといえます。なぜ、それほどこだわる必要があるのでしょう。\r\nあいさつには、礼儀的な意味だけでなく、心理学的にも重要な意味があると考えられています。慶応義塾大学の山本和男教授たちは、近隣騒音の迷惑度が、あいさつを含んだお隣づきあいと関係していることを明らかにしています。\r\n    それによると、騒音を出している家族との間にお隣づきあいがあるかどうかによって、その家から出される音が邪魔だと感じられる割合が異なっているのです。たとえば、音源の人の顔をみたこともない場合には、その音が「やや邪魔」以上に感じる割合は約60パーセントでしだ。ところが、あいさつをする間柄になるとそれが約35パーセントに減り、立ち話をする関係になると20数パーセントに減っています。(A)が、いかに重要であるかがよく分かります。\r\n\r\n注釈：\r\n  こだわる(拘る)「自五」拘泥\r\n  近隣騒音(きんりんそうおん)「連語」近邻噪音\r\n  隣づきあい(となりづきあい)「連語」和邻居交往\r\n  割合(わりあい)「名」比例\r\n  間柄(あいだがら)「名」关系，交情', 'someone', '2018-09-20 10:51:17'),
('1531904738253_12_2', '1531904738253', 2, '次の文のうち、文章の内容と違うものはどれですか', '', 'あいさつ言葉は早くおぼえなければなりません', 'お隣とあいさつをすれば、その家からの騒音が低くなります', '騒音の迷惑度は隣の家とあいさつをしているかどうかによります', 'あいさつにはいろいろな意味があります', 'B', '', 0, 12, '', '', '', 'someone', '2018-09-20 10:51:54'),
('1531904738253_13_1', '1531904738253', 1, '母はいつ亡くなりましたか', '', '1年前', '2年前', '何年前', '今年の夏', 'B', '', 0, 13, '', '', '    遠く離れた実家の冷蔵庫が相当古くなったので、新しい物を贈ることにしました。\r\n    実家には大正生まれの父が1人。畑仕事、慣れない家事をこなしています。そこへ今春、近くの大学に入ったおいが同居することになりました。すると、それまで自分の生活を頑として変えなかった父が、洗濯機を二槽式から全自動にしました。\r\nそれなら冷蔵庫を変えるほうが先、と思った私は、この夏帰省した折に、その代金を提供することにしました。そのお金は何のことはない、亡き母から渡されたものなのです。\r\n    母が病気療養中、私が見舞いや介護に行く度に持たせてくれたものです。今生の別れとなった時に渡された1枚だけは、特別にその時のままの二つ折りで形見としています。1年もの間、普通に呼吸することすら苦しい状態だったのに、娘を気遣おうとした母の姿を思い出すと、2年を過ぎた今でも胸が詰まります。\r\n    ゆえに、使うことも、通帳に入れて数字にしてしまうことも出来ずにもっていたのです。\r\n    そんな母の遺品が今、姿を変えて男所帯の毎日を支えるものとなり、家の片隅でひっそりと輝くことになりました。\r\n母さん、これでよかったんだよね。いつも父を見守っていて下さいな。そう祈っています。\r\n\r\n注釈：\r\n  実家(じっか)「名」老家\r\n  こなす「他五」处理\r\n  頑として(がんとして)「副」顽固地，坚决地\r\n  帰省(きせい)「名 自サ」回家探亲\r\n  折(おり)「名」~的时候\r\n  何(なん)のことはない「連語」不是什么别的，(我)不费力\r\n  介護(かいご)「名 他サ」护理(病人)\r\n  形見(かたみ)「名」纪念(品)\r\n  すら「副助」连……\r\n  胸が詰まる(むねがつまる)「慣用」难过\r\n  通帳(つうちょう)「名」存折\r\n  所帯(しょたい)「名」家，家庭\r\n  ひっそりと「副」静静地，寂静地', 'someone', '2018-09-20 11:11:11'),
('1531904738253_13_2', '1531904738253', 2, '今、実家はどのような状態になっていますか', '', '父の1人暮らしになっています', '家族が少なくなっています', '実家は古くなっています', '父とおいの男だけの家庭になっています', 'D', '', 0, 13, '', '', '', 'someone', '2018-09-20 11:11:50'),
('1531904738253_13_3', '1531904738253', 3, '冷蔵庫の代金はだれが提供したのですか', '', '娘が提供したのです', 'おいが提供したのです', '父が提供したのです', '母が提供したのです', 'D', '', 0, 13, '', '', '', 'someone', '2018-09-20 11:12:25'),
('1531904738253_13_4', '1531904738253', 4, '母の遺品はどのような姿に変わりましたか', '', '二つ折の姿', '冷蔵庫', '洗濯機', '通帳', 'B', '', 0, 13, '', '', '', 'someone', '2018-09-20 11:13:00'),
('1531904738253_14_1', '1531904738253', 1, '「これは、何の気なしにしてしまうことがあるので、」とありますが、\r\n「何の気なしにしてしまうこと」とはどういうことですか', '', '最近の子は夢を持たないと言ってしまうこと', '私たちが心掛けるころを忘れてしまうこと', '子供の夢を否定すること', '子供に何をしたいのかを聞くこと', 'C', '', 0, 14, '', '', '    子の語る夢を「否定しない」\r\n    子供たちに対して、「将来をあきらめている」「何をしたいのか分からない」「疲れている」などの指摘がありますが、私たちが心掛けるべきは、「子供の夢を否定しない、バカにしない」ということです。\r\n    ①これは、何の気なしにしてしまうことがあるので、いましめていきたいですね。」子供は、大人には現実的でないと思える夢をたくさんもちます。しかし、言うたびにそれを否定されたのでは、夢のもちようがなくなってしまいます。\r\n    その夢が現実的でなかったとしても、安易に否定するのではなく、むしろ「それを達成するためにどうすればよいか」を一緒に考え、「あなたの夢を応援している」との姿勢を示していきましょう。\r\n    また、自分の夢をバカにされると、子どきはそれ敏感に感じ取ります。夢をバカにされたと感じた子は、努力をしなくなりますので、悪循環です。\r\n\r\n注釈：\r\n  あきらめる(諦める)「他下一」断念，放弃\r\n  心掛ける(こころがける)「他下一」留意，注意\r\n  バカにする「慣用」轻视，瞧不起\r\n  何の気なし(なんのきなし)「連語」不当回事，不放在心上\r\n  いましめる(戒める)「他下一」告诫，阻止', 'someone', '2018-09-20 11:15:35'),
('1531904738253_14_2', '1531904738253', 2, '子供の夢を否定すると、どのような結果になりますか', '', 'こどもは自分の夢をバカにします', 'こどもは現実からにげだします', 'こどもは現実的になります', 'こどもは努力しなくなります', 'D', '', 0, 14, '', '', '', 'someone', '2018-09-20 11:16:12'),
('1531904738253_14_3', '1531904738253', 3, '大人に戒めてほしいことは何ですか', '', '子どもと同じ夢を持つこと', '子どもと一緒に夢を考えること', '子どもの夢をバカにしないこと', '子どもの夢を応援しないこと', 'C', '', 0, 14, '', '', '', 'someone', '2018-09-20 11:16:45'),
('1531904738253_15_1', '1531904738253', 1, '「この技術を使って」という文は次のどれを指していますか', '', '人間と試合をすること', '人間を助けること', '自分で考えて動くコンピュータ', '料理を作ること', 'C', '', 0, 15, '', '', '    未来のロボット\r\n    今はまだ、コンピュータは人間が命令しないと動きません。しかし、将来はコンピュータが自分で考えて動くようになるでしょう。①この技術を使ってロボットを作る計画があります。現在、ロボットだけのサッカーチームを作って、人間と試合をするという研究が進められています。2050年までには、人間のチームに勝てる、強いロボットのサッカーチームができるそうです。\r\n    ロボットは、サッカーだけでなく、ほかのこともできろようになります。ロボットは、例えば火事や海の中など、人間によって行きにくい場所に行くことができるようになります。\r\n    そして、人間をたすけたり、資源を探したりすることもできるようになるでしょう。\r\n    また、将来は、どこの家もロボットを持つようになるでしょう。料理を作るロボット、掃除をするロボット、買い物をするロボットなどができるでしょう。人間の仕事をロボットがするようになったら、人間は何をしたらいいのでしょう。未来の人間にとって、自分が何をするかを考えることが、いちばんたいへんな仕事になるかもしれません。\r\n\r\n注釈：\r\n  ロボット「名」机器人\r\n  サッカーチーム「名」足球队\r\n  たすける(助ける)「他下一」帮助，救助', 'someone', '2018-09-20 11:20:00'),
('1531904738253_15_2', '1531904738253', 2, '未来の人間にとっていちばんたいへんな仕事は何ですか', '', 'もっといいロボットを作る研究をすることです', 'ロボットをコントロールすることです', 'ロボットにもっとたくさんの仕事をさせることです', '自分が何をしたらいいかを考えることです', 'D', '', 0, 15, '', '', '', 'someone', '2018-09-20 11:20:43'),
